import React, { Fragment } from "react";

// Import components
import ProfilePhoto from "./profilePhoto";

// Import styles
import s from "../../../styles/profile.module.css";

const Profile = () => {
  return (
    <Fragment>
      <div className={s.ProfileContainer}>
        <ProfilePhoto />
      </div>
    </Fragment>
  );
};

export default Profile;
